import {
  Button,
  Card,
  CardContent,
  CardMedia,
  CardActions,
  Typography,
  Grid,
  CardActionArea,
} from "@material-ui/core";
import MealItem from './MealItem/MealItem';
import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
  {
    id: 'm1',
    image: "",
    name: 'Banana',
    description: 'Finest chicken and veggies',
    price: 22.99,
  },
  {
    id: 'm2',
    image: "",
    name: 'Maça',
    description: 'A special veg dish',
    price: 16.5,
  },
  {
    id: 'm3',
    image: "",
    name: 'Kiwi',
    description: 'Raw, meaty',
    price: 12.99,
  },
  {
    id: 'm4',
    image: "",
    name: 'Limão',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm5',
    image: "",
    name: 'Tomate',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm6',
    image: "",
    name: 'Brócolis',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm7',
    image: "",
    name: 'Couve',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm8',
    image: "",
    name: 'Cenoura',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm9',
    image: "",
    name: 'Salsa',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm10',
    image: "",
    name: 'Tangerina',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm11',
    image: "",
    name: 'Laranja',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm12',
    image: "",
    name: 'Melão',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm13',
    image: "",
    name: 'Melancia',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm14',
    image: "",
    name: 'Manga',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm15',
    image: "",
    name: 'Tomate Cereja',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm16',
    image: "",
    name: 'Aspargo',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm17',
    image: "",
    name: 'Cogumelo',
    description: 'Healthy...and green...',
    price: 18.99,
  },
  {
    id: 'm18',
    image: "",
    name: 'Uva',
    description: 'Healthy...and green...',
    price: 18.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      image={meal.image}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={classes.meals}>
     <Grid
            container
            spacing={3}
            direction="row"
            justify="space-between"
            alignItems="flex-start"
          >
            <Grid item xs={6} md={3}>
            <Card sx={{ maxWidth: 345 }} >
                <CardActionArea>
                  <CardMedia
                    component="img"
                    height="140"
                    image={item.image}
                    alt="no image"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      {mealsList.name}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {item.description}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {item.price}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {item.total}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button size="small" color="primary">
                      Adicionar
                    </Button>
                  </CardActions>
                </CardActionArea>
              </Card>
      </Grid>
      </Grid>
    </section>
  );
};

export default AvailableMeals;
